import React from 'react';
import Menu from './menu';
import Router from 'next/router'

function home(props) {


    return (
        <div>
            <Menu />
            <h1>Home</h1>
            <button onClick={() => Router.push("/home")}>Sobre</button>
        </div>
    );
}

export default home;
